//react
import React, {useEffect} from "react";

//css
import "./index.scss";

//components
import Logo from "../../components/Logo/Logo"
import HomeView from "../Home/HomeView"
import PhotosView from "../Photos/PhotosView"
import SmoothScroll from "../../components/SmoothScroll/SmoothScroll"

//external
import Aos from 'aos'
import "aos/dist/aos.css";
import ParticlesBg from 'particles-bg';

class Root extends React.Component {

  state = { 
    isHomeViewOpen: true 
  };

  navigationClicked = (param) => {
    SmoothScroll.handleScrollEvent(param);
  };

  ZobaczWiecejClicked = () => {
    this.setState( prevState => ({
      isHomeViewOpen: !prevState.isHomeViewOpen
    }));

    this.navigationClicked("logo");
  };

  render() {

    let noBullets = {
      listStyleType : "none"
    };

    Aos.init({duration:2000});

    return (

      <div id="website">

        <ParticlesBg color="#D1D1D1" num={200} type="cobweb" bg={true} />

        <div id="logo">
          <Logo />
        </div>

        <div id="nav">
        {this.state.isHomeViewOpen === true &&
        <>
              <div onClick={()=>{this.navigationClicked("whatWeDo")}}              id="navItem" className="example"><span className="hover hover-3">O nas&nbsp;</span>|</div>
              <div onClick={()=>{this.navigationClicked("offer")}}              id="navItem" className="example"><span className="hover hover-3">&nbsp;Oferta&nbsp;</span>|</div>
              <div onClick={()=>{this.navigationClicked("portfolio")}}              id="navItem" className="example"><span className="hover hover-3">&nbsp;Portfolio&nbsp;</span>|</div>
              <div onClick={()=>{this.navigationClicked("contact")}}              id="navItem" className="example"><span className="hover hover-3">&nbsp;Kontakt&nbsp;</span></div>       
       </>
        }
        </div>
        {/* :""} */}
       {this.state.isHomeViewOpen === true ? <HomeView/> : <PhotosView stateChange={this.ZobaczWiecejClicked}/>} 

       {this.state.isHomeViewOpen === true && 
            <div id="seeMore" onClick={this.ZobaczWiecejClicked}>
                  Zobacz wiecej
             </div>         
      } 


        <div id="contact">

          <h4>Kontakt</h4>
          <div id="SectionContent">

          interbuild Krzysztof Wojtysiak<br></br>
          Telefon: 884 706 234 / 605987121<br></br>
          E-mail: kw.interbuild@gmail.com<br></br>
          NIP: 829-174-44-64<br></br><br></br>

          </div>
        </div>
        <div id="footer">Paweł Łabuz pawel.labuz10@gmail.com</div>
      </div>
    );
  }
}

export default Root;

// 3. Dopasować Form.js do nowych potrzeb
